import React from 'react';

const Home = () => {
  const vector = "/assets/Vector.png";
  const imageremove = "/assets/homeBgImage.png";

  return (
    <div className='bg-[#DAE5F5] w-full h-full flex flex-col items-center justify-center text-center p-'>
      <img src={imageremove} alt="Placeholder" className='mb-4' />
      <h1 className='text-2xl font-bold mb-2'>Pocket Notes</h1>
      <p className='mb-6'>
        Send and receive messages without keeping your phone online.<br />
        Use Pocket Notes on up to 4 linked devices and 1 mobile phone.
      </p>
      <div className='flex items-center'>
        <img src={vector} alt="Lock" />
        <span className="text-sm text-gray-600 ml-2">end-to-end encrypted</span>
      </div>
    </div>
  );
};

export default Home;
